import { useState } from 'react';

const SignUp = () => {
  const [name, setName] = useState(null);

  return (
    <>
      <h1>新規登録</h1>
      <form onSubmit={''} className='signup-form'>
        <input
          type='text'
          placeholder='氏名（20文字以内）'
          value={''}
          onChange={(e) => {}}
        />
        <input
          type='date'
          placeholder='生年月日'
          value={'dob'}
          onChange={(e) => {}}
        />
        <input
          type='email'
          placeholder='メールアドレス'
          value={''}
          onChange={(e) => {}}
        />
        <input
          type='password'
          placeholder='パスワード'
          value={''}
          onChange={(e) => {}}
        />
        <input
          type='password'
          placeholder='確認パスワード'
          value={''}
          onChange={(e) => {}}
        />
        <div className='checkbox-container'>
          <label>
            <input
              type='checkbox'
              checked={false}
              onChange={(e) => {}}
              className='input-checkbox'
            />
            規約同意
          </label>
        </div>
        <button type='submit' className='submit-button'>
          登録
        </button>
      </form>
    </>
  );
};

export default SignUp;
